for n in range(2, max_num + 1):
    # Initialize the complexity of n to a large number
    complexity[n] = float('inf')
    # Check all possible ways to form n using addition
    for i in range(1, n // 2 + 1):
        complexity[n] = min(complexity[n], complexity[i] + complexity[n - i])
    # Check all possible ways to form n using multiplication
    for i in range(1, int(math.sqrt(n)) + 1):
        if n % i == 0:
            complexity[n] = min(complexity[n], complexity[i] + complexity[n // i])

# Print the updated complexity list
print(complexity)

